library test_ticks_position;

import 'package:chartxl/src/util.dart';
import 'package:chartxl/src/tick.dart';
import 'package:chartxl/src/grid.dart';

import 'test_all.dart';
import 'dart:math';

test_ticks_position() {  
  Grid grid = new Grid(
       new List.generate(stage.stageWidth~/100, (i) => i*100), 
       new List.generate(stage.stageHeight~/100, (i) => i*100), 
       stage.stageWidth, stage.stageHeight);
  stage.addChild(grid);
  
  
  var tickDown = new Tick("A really superlong Text", Direction.DOWN, tickLength: 20, tickPadding:10)
      ..x = 100
      ..y = 100;
  stage.addChild(tickDown);

  var tickUp = new Tick("A text for an UP Tick", Direction.UP, tickLength: 20, tickPadding:10)
      ..x = 100
      ..y = 400;
  stage.addChild(tickUp);

  var tickLeft = new Tick("Another long text label", Direction.LEFT, tickLength: 20, tickPadding:10)
      ..x = 300
      ..y = 100;
  stage.addChild(tickLeft);

  var tickRight = new Tick("A text for a RIGHT tick", Direction.RIGHT, tickLength: 20, tickPadding:10)
      ..x = 300
      ..y = 400;
  stage.addChild(tickRight);
  
  // a tick with a rotated label    
  var tickRotated45 = new Tick("Rotated 45", Direction.DOWN, textRotation: PI/4)
      ..x = 400
      ..y = 100;
  stage.addChild(tickRotated45);
  
  var tickRotated90 = new Tick("Rotated 90", Direction.DOWN, textRotation: PI/2)
      ..x = 500
      ..y = 100;
  stage.addChild(tickRotated90);
  
  
  stage.onRender.listen((e) {    
    String dataURL = canvas.toDataUrl();
    print(dataURL);
    if (dataURL == "data:image/png;base64,") {
      print("PASSED: test_ticks_position");
    } else {
      print("FAILED: test_ticks_position");
    }
  });
  
  
}
